export default function Portfolio() {
  return (
    <section className="flex pt-24 flex-col items-center h-screen bg-phone bg-cover">
      <div>
        <h1 className="font-title text-4xl lg:text-6xl text-shadow-md text-neutral-600">
          PORTFOLIO
        </h1>
      </div>
      <div className="flex flex-col w-full items-center pb-12">
        <img src="images/porfolioImages/IMG_0109.png" alt="" />
      </div>
    </section>
  );
}
